function Home (){

    return (
        <div>
            <div className={homeCSS.sidePanel}>
                <h1 className={homeCSS.brand}><img src={logo} />SESH</h1>
                <h2>Home</h2>
                <h2>Genre</h2>
                <h2>Create Playlist</h2>
            </div>
            <div className={homeCSS.searchPanel}>
                <input />
            </div>
            <div className={homeCSS.contentPanel}>
                
            </div>
            <h1>Home</h1>
        </div>
    )
}

export default Home;
